import React from 'react';
import './Home.css';
import logo from './imagini/logo.png'; 
import img1 from './imagini/img1.png'; 
import img2 from './imagini/img2.png';
import petriImg from './imagini/petri.png';

function Home({ onCreateAccount, onLogin }) {
  return (
    <div className="landing-root">
      <header className="landing-header">
        <div className="logo-group">
          <img src={logo} alt="Canvas 2 SVG Logo" className="logo-icon" />
          <span className="logo-title">
            Canvas <br />2 SVG
          </span>
        </div>
      </header>
      <main className="landing-main">
        <section className="landing-left">
          <h1 className="landing-title">
            Desenează grafuri<br />
            & diagrame <span className="highlight">direct</span><br />
            în browser
          </h1>
          <p className="landing-desc">
            Canvas 2 SVG este aplicația pentru desen online de <b>grafuri, UML, rețele Petri</b> și <b>automate</b>, cu export rapid în <b>SVG</b> pentru integrare în pagini web.
          </p>
          {/* <div className="landing-actions">
            <button className="btn create" onClick={onCreateAccount}>Create account</button>
            <button className="btn login" onClick={onLogin}>Log in</button>
          </div> */}
        </section>
       {/* <section className="landing-right">
          <img src={img1} alt="Exemplu diagramă" className="landing-img" />
          <img src={img2} alt="Exemplu diagramă" className="landing-img" />
          <img src={petriImg} alt="Exemplu rețea Petri" className="landing-img" />
        </section>
        */}
      </main>
    </div>
  );
}

export default Home;
